const words = {
  'zh-CN': {
    title: '\u54C8\u62FC\u6F14\u7EC3\u573A',
    desc: '\u54C8\u62FC\u6F14\u7EC3\u573A\u662F\u4E3A\u521D\u5B66\u8005\u51C6\u5907\u7684\u76F4\u89C2\u7EC3\u4E60',
  },
  'en-US': {
    title: 'Hapin Playground',
    desc: '',
  },
};

const qwerty_keyboard = [
  ['q', 'w', 'e', 'r', 't', 'y', 'u', 'i', 'o', 'p'],
  ['a', 's', 'd', 'f', 'g', 'h', 'j', 'k', 'l', ';'],
  ['z', 'x', 'c', 'v', 'b', 'n', 'm', ',', '?'],
];

